        public static Race Copy(
            Race item,
            Race_CopyMask copyMask = null,
            Race def = null)
        {
            Race ret;
            if (item.GetType().Equals(typeof(Race)))
            {
                ret = new Race();
            }
            else
            {
                ret = (Race)System.Activator.CreateInstance(item.GetType());
            }
            ret.CopyFieldsFrom(
                item,
                copyMask: copyMask,
                def: def);
            return ret;
        }

