                case Race_FieldIndex.Name:
                    this.Name = (String)obj;
                    break;
                case Race_FieldIndex.Description:
                    this.Description = (String)obj;
                    break;
                case Race_FieldIndex.Spells:
                    this._Spells.SetTo((ISetList<IFormIDLink<Spell>>)obj);
