                CopyInInternal_Race(ret, pair);
            }
            return ret;
        }

        protected new static void CopyInInternal_Race(Race obj, KeyValuePair<ushort, object> pair)
        {
            if (!EnumExt.TryParse(pair.Key, out Race_FieldIndex enu))
            {
